import s from './EventSection.module.css';

const EventSection = () => {
	return (
		<div className={s.events}>
			<div className={s.events_item}></div>
			<div className={s.events_item}></div>
			<div className={s.events_item}></div>
			<div className={s.events_item}></div>
		</div>
	);
};

export default EventSection;
